window.bookSummaryJSON = "<p><b><i>Medusa Uploaded</i></b><b> by Emily Devenport offers listeners a fast-paced science fiction thriller on the limits of power and control and the knife-edge between killing for revenge or a greater good </b>&nbsp;</p> <p><i>My name is Oichi Angelis, and I am a worm. They see me every day. They consider me harmless. And that's the trick, isn't it?</i>&nbsp;</p> <p>A generation starship can hide many secrets. When an Executive clan suspects Oichi of insurgency and discreetly shoves her out an airlock, one of those secrets finds and rescues her. Officially dead, Oichi begins to rebalance power one assassination at a time and uncovers the shocking truth behind the generation starship and the Executive clans.</p>"; 
